let players = [
    {id: 0, name:'Tom Brady', position:'Quarterback', rating: '97', img:'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS6bQfyL1K-w28NuNSzzGBW1VrjZvBu-okKQdh6277LD_s4_f27'},
    {id: 1, name:'Julian Edelman', position:'Wide receiver', rating: '89', img:'data:image/jpeg;base64,'},
    {id: 2, name:'Aaron Donald', position:'Defensive tackle', rating:'99', img:'data:image/jpeg;base64,'},
    {id: 3, name:'Russell Wilson', position:'Quarterback', rating:'95', img:'data:image/jpeg;base64,'},
    {id: 4, name:'Todd Gurley', position:'Running back', rating:'94', img:'data:image/jpeg;base64,'},
    {id: 5, name:'DeAndre Hopkins', position:'Wide receiver', rating:'99', img:'data:image/jpeg;base64,'}
]

module.exports = {
    addPlayers: (req, res) => {
        players.length
        ? id = players[players.length - 1].id + 1
        : id = 0
    
        const newPlayers = {
            name: req.body.name,
            position: req.body.position,
            rating: req.body.rating,
            img: req.body.img,
            id
        }
        players.push(newPlayers)
        res.status(200).send(players)
    },
    getPlayers: (req, res) => {
        res.status(200).send(players)
    },
    updatePlayers: (req, res) => {
        const {id} = req.params
        const updatedPlayers = req.body

        let myPlayers = players.find(players => {
            return players.id === +id
        })

        myPlayers.name = updatedPlayers.name
        myPlayers.position = updatedPlayers.position
        myPlayers.rating = updatedPlayers.rating
        myPlayers.img = updatedPlayers.img
        
        res.status(200).send(players)
    },
    deletePlayers: (req, res) => {
        const {id} = req.params
        players = players.filter(player => {
            if(player.id !== +id) return player
        })
        res.status(200).send(players)
    } 
}